import React from 'react';
import '../styles/components/pages/HomePage.css';

const HomePage = (props) => {
  return (
    <main className="holder">
      <div className="homeimg">
        {/* 1. CAMBIA LA IMAGEN DEL AVIÓN */}
        <img src="/images/home/gaming-setup.jpg" alt="Gaming Setup" />
      </div>
      <div className="columnas">
        <div className="bienvenidos">
          {/* 2. CAMBIA LOS TEXTOS */}
          <h2>Últimos Lanzamientos</h2>
          <p>Descubre el hardware más potente para llevar tu juego al siguiente nivel. Tarjetas gráficas, procesadores y periféricos de alta gama.</p>
        </div>
        <div className="testimonios">
          <h2>Reviews de Clientes</h2>
          <div className="testimonio">
            {/* 3. CAMBIA EL TESTIMONIO */}
            <span className="cita">¡Los mejores precios y envío rápido!</span>
            <span className="autor">GamerPro88</span>
          </div>
        </div>
      </div>
    </main>
  );
}

export default HomePage;
